import { React } from "react";
import { FilterLink } from "../containers/FilterLink";

const Footer = () => {

    <p>
        Show:
        {" "}
        <a filter="SHOW_ALL">
        All 
        </a>
        {", "}
        <a filter="SHOW_ACTIVE">
        Active
        </a>
        {", "}
        <a filter="SHOW_COMPLETED">
        completed 
        </a>
    </p>
}
export default Footer;
